import React from 'react';
import { useLocation } from 'react-router-dom';
import { Link } from 'react-router-dom';

const Dashboard = () => {

  const location = useLocation();
  const { username } = location.state || {};

  return (
    <div>
        <Link to="/Admin">
            <button type="button">
            Adminoooooooooooooo
        </button>
            </Link>

    </div>
  );
};

export default Dashboard;
